import java.util.*;

class Solution {
    static final int MOD = (int) 1e9 + 7;

    public int maximumScore(List<Integer> nums, int k) {
        int[] maxPrimeScore = new int[100001];
        for (int i = 2; i < maxPrimeScore.length; i++) {
            if (maxPrimeScore[i] == 0) { // i is prime
                for (int j = i; j < maxPrimeScore.length; j += i) {
                    maxPrimeScore[j]++;
                }
            }
        }

        PriorityQueue<Integer> pq = new PriorityQueue<>((a, b) -> {
            int cmp = Integer.compare(maxPrimeScore[b], maxPrimeScore[a]);
            if (cmp == 0) return Integer.compare(a, b);
            return cmp;
        });

        pq.addAll(nums);

        long score = 1;
        for (int i = 0; i < k; i++) {
            score = (score * pq.poll()) % MOD;
        }

        return (int) score;
    }
}
